import React from 'react';
import './App.css';
import {Todolist} from "./Components/Todolist";

function App() {

    const title = 'What to learn-1';
    const title2 = 100200;
    const title3 = true;

    return (
        <div className="App">
            <Todolist title={title} title2={title2}/>
            <Todolist title={"What to learn-2"} title3={true}/>
        </div>
    );
}

export default App;
